vector<int> ArcoMinimo(const vector<vector<double>> &matriz)
{
    double minArc = INT32_MAX;
    int NodoInicio = -1;
    int N = matriz[0].size();
    for (int i = 0; i < N; ++i)
    {
        for (int j = 0; j < N; ++j)
        {
            if (i != j && matriz[i][j] < minArc)
            {
                minArc = matriz[i][j];
                NodoInicio = i;
            }
        }
    }

    return vecinoMasCercano(matriz, NodoInicio, N);
}

